    public class SmtpCorreoService : ICorreoService
    {
        private readonly IConfiguration _configuracionCorreo;
        private readonly IRabbitEventBus _rabbitEventBus;

        public SmtpCorreoService(IConfiguration configuracionCorreo, IRabbitEventBus rabbitEventBus)
        {
            _configuracionCorreo = configuracionCorreo;
            _rabbitEventBus = rabbitEventBus;
        }

        public async Task EnviarCorreoAsync(string destinatario,string asunto,string cuerpo,string servidorSmtp,int? puertoSmtp,string usuarioEmail, string passwordEmail)
        {
            var pdfBase64 = "";
            var xmlBase64 = "";

            // Crear un nuevo archivo ZIP en memoria
            using (var zipStream = new MemoryStream())
            {
                using (var zipArchive = new ZipArchive(zipStream, ZipArchiveMode.Create, true))
                {
                    // Agregar el archivo PDF al archivo ZIP
                    var entryPdf = zipArchive.CreateEntry("documento.pdf");
                    using (var entryStreamPdf = entryPdf.Open())
                    {
                        var pdfBytes = Convert.FromBase64String(pdfBase64);
                        entryStreamPdf.Write(pdfBytes, 0, pdfBytes.Length);
                    }

                    // Agregar el archivo XML al archivo ZIP
                    var entryXml = zipArchive.CreateEntry("documento.xml");
                    using (var entryStreamXml = entryXml.Open())
                    {
                        var xmlBytes = Convert.FromBase64String(xmlBase64);
                        entryStreamXml.Write(xmlBytes, 0, xmlBytes.Length);
                    }
                }



                var emailFrom = new CorreoConfig
                {
                    ServidorSmtp = servidorSmtp,
                    PuertoSmtp = puertoSmtp,
                    Usuario = usuarioEmail,
                    Contraseña = passwordEmail
                };

                //var emailFrom = new CorreoConfig
                //{
                //    ServidorSmtp = _configuracionCorreo.GetSection("CorreoConfig:ServidorSmtp").Value,
                //    PuertoSmtp = int.Parse(_configuracionCorreo.GetSection("CorreoConfig:PuertoSmtp").Value),
                //    Usuario = _configuracionCorreo.GetSection("CorreoConfig:Usuario").Value,
                //    Contraseña = _configuracionCorreo.GetSection("CorreoConfig:Contraseña").Value
                //};



                // Configuración del correo
                var correo = new MailMessage();
                correo.From = new MailAddress(emailFrom.Usuario);
                correo.To.Add(new MailAddress(destinatario));
                correo.Subject = asunto;
                correo.Body = cuerpo;
                correo.IsBodyHtml = true; // Esta línea permite que el cuerpo del correo sea HTML


                zipStream.Position = 0; // Reiniciar la posición del stream antes de usarlo
                var attachmentz = new Attachment(zipStream, "archivos_adjuntos.zip", "application/zip");

                correo.Attachments.Add(attachmentz);

                // Envío del correo
                using (var clienteSmtp = new SmtpClient(emailFrom.ServidorSmtp, (int)emailFrom.PuertoSmtp))
                {
                    clienteSmtp.Credentials = new System.Net.NetworkCredential(emailFrom.Usuario, emailFrom.Contraseña);
                    clienteSmtp.EnableSsl = true;
                    await clienteSmtp.SendMailAsync(correo);
                }
            }
        }

